import axios from "axios";



export const getRecordings = async(
    userId,
    callback
) => {
    try{
        const response = await axios.get(`https://192.168.0.114:5000/api/files/get_recordings/${userId}`)
        console.log(response.data)
        callback(response.data)
    } catch(e){
        alert(e)
    }
}
